import React from 'react';
import { BrowserRouter, Route, Link } from 'react-router-dom';
import StreamCreate from './streams/StreamCreate';
import StreamDelete from './streams/StreamDelete';
import StreamList from './streams/StreamList';
import StreamShow from './streams/StreamShow';
import StreamEdit from './streams/StreamEdit';

const App = () => {
    return (
        <div>
            <BrowserRouter>
                <div>
                    <Rout path='/' exact component={StreamList} />
                    <Rout path='/streams/new' exact component={StreamCreate} />
                    <Rout path='/streams/edit' exact component={StreamEdit} />
                    <Rout path='/streams/delete' exact component={StreamDelete} />
                    <Rout path='/streams/show' exact component={StreamShow} />
                </div>
            </BrowserRouter>
        </div>
    );
}

export default App;
